public class SplitTwoStringsToMakePalindrome {
    public static void main(String[] args) {
        String a, b;

//        a = "abdef";
//        b = "fecab";
        //a = "";
        //b = "";

        a = "aejbaalflrmkswrydwdkdwdyrwskmrlfqizjezd";
        b = "uvebspqckawkhbrtlqwblfwzfptanhiglaabjea";

        long startTime = System.nanoTime();
        //System.out.println(new SplitTwoStringsToMakePalindrome().checkPalindromeFormation(a, b));
        //System.out.println(System.nanoTime() - startTime);


//        a = "";
//        b = "";

        startTime = System.nanoTime();
        System.out.println(new SplitTwoStringsToMakePalindrome().checkPalindromeFormation2(a, b));
        System.out.println(System.nanoTime() - startTime);
        //417343
        //816311
    }

    public boolean checkPalindromeFormation2(String a, String b) {
        if (a.length() == 1)
            return true;
        return (check(a, b) || check(b, a));
    }

    public boolean check(String a, String b) {
        for (int i = 0, j = a.length() - 1; i < j; i++, j--)
            if (a.charAt(i) != b.charAt(j)) {
                return checkPalindrome(a , i, j) || checkPalindrome(b , i, j) ;
            }
        return true;
    }

    public boolean checkPalindrome(String a, int i, int j) {
        for (; i < j; ++i, --j) {
            if (a.charAt(i) != a.charAt(j)) {
                return false;
            }
        }
        return true;
    }


    public boolean isPalindrome(String str) {
        StringBuilder sb = new StringBuilder(str);
        return str.equals(sb.reverse().toString());
    }
}
